  "completeness.Citations/Footnotes Needed": "Citations/Notes de bas de page nécessaires",
  "completeness.general_modal_text_2": "Le niveau d'exhaustivité d'une entrée est attribué manuellement par notre équipe d'édition. Les entrées complètes contiennent la plupart des données demandées dans le formulaire d'entrée, comprennent au moins trois sections du récit écrit à l'aide de citations (notes de bas de page), et ne nécessitent aucune correction significative de leur grammaire ou de leur orthographe. Si vous remplissez une entrée, veuillez envoyer un e-mail %s pour demander un réexamen afin qu'il puisse être correctement étiqueté.",
  "completeness.general_modal_text_3": "S'il vous plaît lire notre %sLignes directrices%s sur la façon d'écrire une entrée ou contactez-nous pour plus d'informations.",
