  "completeness.partial_citations_alert": "%sL'entrée suivante est des citations manquantes.%s S'il vous plaît nous aider %svérifier son contenu%s.",
  "completeness.partial_citation_modal_text_1": "Ce type d'entrée est manquant citations (notes de bas de page), mais est par ailleurs complète. Les entrées nécessitant des citations peuvent être identifiées à l'aide du filtre de recherche « l'exhaustivité de l'entrée » sur la page d'accueil.",
  "completeness.partial_content_alert": "%sL'entrée suivante est incomplète.%s Vous pouvez aider Participedia en %sajouter à elle%s.",
  "completeness.partial_content_modal_text_1": "Les inscriptions partielles sont à peu près à moitié complètes, et font de bonnes places de départ pour les étudiants et toute personne intéressée à contribuer à Participedia. Des entrées plus partielles peuvent être trouvées à l'aide du filtre de recherche « l'exhaustivité de l'entrée » sur la page d'accueil.",
  "completeness.partial_editing_alert": "%sL'entrée suivante a besoin d'aide pour le contenu et l'édition.%s S'il vous plaît nous aider %scompléter%s.",
  "completeness.partial_editing_modal_text_1": "Ce type d'entrée a besoin d'améliorations significatives de sa grammaire ou de son orthographe, et peut être n'importe quel niveau d'exhaustivité (stub, partiel ou complet). Les entrées nécessitant des modifications de grammaire ou d'orthographe peuvent être identifiées à l'aide du filtre de recherche « complétude d'entrée » sur la page d'accueil.",
  "completeness.Stub": "Stub",
  "completeness.stub_alert": "%sL'entrée suivante est un talon.%s S'il vous plaît nous aider %scompléter%s.",
  "completeness.stub_modal_text_1": "Les entrées Stub contiennent peu d'informations au-delà d'un titre, offrant des places de départ idéales pour les étudiants et toute personne intéressée à contribuer à Participedia. Plus d'entrées de talon peuvent être trouvées à l'aide du filtre de recherche « l'exhaustivité d'entrée » sur la page d'accueil.",
