  "content_types.review_entries.description": "Les nouvelles entrées doivent être approuvées par un administrateur. L'approbation d'une entrée approuvera automatiquement toutes les entrées de cet utilisateur, et ses futures entrées ne nécessiteront pas de révision. Le blocage d'une entrée bloquera cet utilisateur et supprimera définitivement toutes ses entrées de la base de données, veuillez les examiner attentivement.",
