  "federal.university.minas.gerais": "L&#39;emplacement %s de la prochaine école Participedia à l&#39;Université fédérale du Minas Gerais (UFMG) a été annulé %s en raison d&#39;une grève en cours du personnel des universités fédérales brésiliennes. Nous sommes solidaires de nos collègues de l’UFMG et des mouvements qui défendent la démocratie, et nous ne franchirons pas la ligne de piquetage. Nous ne sommes malheureusement pas en mesure d&#39;offrir des places dans nos écoles alternatives en raison des limites de capacité d&#39;inscription. Cependant, nous invitons les personnes intéressées à %s rejoindre la liste d&#39;attente %s . Merci pour votre compréhension.",
