  "Getting started guide": "Guide de démarrage",
  "getting-started.editors.key_considerations": "Considérations clés pour les éditeur.rices",
  "getting-started.editors.key_considerations.p0": "Utilisez le site dans la langue de votre choix. Toutes les modifications de données fixes sont appliquées dans toutes les langues, et les modifications de texte sont appliquées dans votre langue uniquement. Pour en savoir plus sur le fonctionnement des traductions, consultez nos %sfaq%s.",
  "getting-started.editors.key_considerations.p1": "Sur la page de %s recherche %s, utilisez le filtre de recherche appelé « intégralité de l' entrée » pour trouver des entrées répertoriées comme talons, partiellement complètes, ou le contenu qui nécessite des citations. Par exemple, voici les cas %s signalés comme talons %s .",
  "getting-started.editors.key_considerations.p2": "Ajoutez des informations ou des images liées à un événement participatif auquel vous avez assisté",
  "getting-started.editors.key_considerations.p3": "Utilisez les filtres de recherche pour rechercher les cas qui ont eu lieu près de chez vous. Après avoir effectué vos recherches, ajoutez plus de contenu à ces entrées. Par exemple, une entrée peut bénéficier de liens vers des documents d'appui et des sites web externes.",
  "getting-started.editors.key_considerations.p4": "Cliquez sur l'icône rouge flottante «modifier» sur n'importe quelle entrée pour commencer.",
  "getting-started.editors.p1": "Les éditeur.rices en chef du projet examinent le contenu Participedia, organisent les collections et signalent les entrées nécessitant de l'édition pour des raisons d'exhaustivité ou encore si le contenu nécessite des citations. Toustes les utilisateurs sont encouragé.es à aider à améliorer les entrées Participedia faites par d'autres contributeur.rices. Cela pourrait inclure, par exemple, des choses aussi élémentaires que l'amélioration de la grammaire et de la lisibilité, la révision des traductions d'entrées qui ont été %s traduites automatiquement %s dans d'autres langues, et l'ajout d'images ou de liens vers des documents de support et des sites web pertinents. Les utilisateur.rices possédant une expertise pertinente en la matière sont invité.es à apporter des modifications substantielles aux entrées.",
  "getting-started.Looking for more information?": "Vous cherchez plus d'informations?",
  "getting-started.p1": "N'importe qui peut aider à documenter les initiatives participatives en publiant et en éditant des entrées sur participedia.net.",
  "getting-started.p2": "Participedia est une plateforme de crowdsourcing et un réseau mondial pour les chercheur.es, les enseignant.es, les praticien.nes, les décideur.ses politiques, les activistes et toute personne intéressée par la participation publique et les innovations démocratiques. Le site abrite plus de 1600 cas provenant de plus de 120 pays, et compte une communauté active de contributeur.rices qui utilisent le site pour étudier et concevoir des méthodes efficaces d'engagement des citoyen.nes. Le site est actuellement disponible en sept langues, et présente deux types de contributeur.rices clés : Les rédacteur.rices et les éditeur.rices.",
  "getting-started.p3": "Nous sommes impatient.es de vous accueillir en tant que rédacteur.rice ou éditeur.rice sur Participedia.net! Une fois que vous aurez commencé, vous pourrez retrouver toutes vos contributions sur votre %s s page de profil %s .",
  "getting-started.p4": "Notre %s Guide rapide de l'utilisateur.rice %s développe des précisions sur les considérations principales exposées ci-dessus. Pour en savoir plus, lisez %s à propos de Participedia %s, informez-vous sur nos %s recherches %s ou consultez notre liste de %s s ressources pédagogiques %s . Les réponses aux questions fréquemment posées peuvent être trouvées %s ici %s . Si vous avez besoin d'aide supplémentaire, veuillez envoyer un %s courriel à notre équipe de soutien %s.",
  "getting-started.publishers.key_considerations": "Considérations clés pour les rédacteur.rices",
  "getting-started.publishers.key_considerations.p1": "Participedia contient %s trois types d'entrées %s : cas, méthodes et organisations. Pour en savoir plus sur les types d'entrées, consultez notre %s FAQ %s .",
  "getting-started.publishers.key_considerations.p2": "Comme Wikipedia, Participedia se concentre sur la documentation plutôt que sur la persuasion ou l'opinion.",
  "getting-started.publishers.key_considerations.p3": "Tout le contenu doit être cité afin que les lecteur.rices puissent vérifier les sources originales.",
  "getting-started.publishers.key_considerations.p4": "Les contributions doivent provenir de sources crédibles lorsqu'elles sont disponibles, telles que des articles universitaires, des rapports, des évaluations officielles, des sites web officiels des organisations concernées ou des organes de presse.",
  "getting-started.publishers.key_considerations.p5": "Utilisez le site dans la langue de votre choix. Les nouvelles entrées sont automatiquement traduites dans toutes les langues prises en charge, mais seulement la première fois qu'elles sont publiées. Pour en savoir plus sur le fonctionnement des traductions, consultez notre page %sfaq%s.",
  "getting-started.publishers.key_considerations.p6": "Écrivez à la troisième personne, et non pas à la première personne.",
  "getting-started.publishers.key_considerations.p7": "Cliquez sur le bouton %s «Soumission rapide» %s sur le bureau ou sur «+» sur un mobile pour commencer.",
  "getting-started.publishers.p1": "Beaucoup des personnes qui publient de nouvelles entrées sur Participedia sont des étudiant.es, praticien.nes ou des organisateur.rices d'événements participatifs. Les étudiant.es peuvent se voir attribuer des travaux de cours qui impliquent de rechercher et de documenter des initiatives participatives, telles que %s cette collection %s développée par des diplômé.es de l'Institut international Coady de l'Université St. Francis Xavier. Les praticien.nes et les activistes utilisent le site pour documenter et faire connaître les méthodes, les cas et les organisations.",
  "getting-started.publishers.p2": "Les personnes qui publient des articles sur Participedia bénéficient d'une plus grande visibilité de leur travail, tout en contribuant à un effort de collaboration pour documenter les initiatives participatives. Le contenu apporté par les «participedien.nes» permet à d'autres d'explorer une base de données vaste et diversifiée d'exemples de cas inspirants et les méthodes qui les informent.",
