  "Home": "Accueil",
  "home.about.p1": "Notre mission est de renforcer et de mobiliser les connaissances sur les innovations en matière de démocratie participative dans le monde entier.",
  "home.about.p2": "Nous fournissons un modèle open source pour le crowdsourcing et l'organisation des données sur la participation publique. Son contenu est généré et utilisé par divers réseaux de chercheur.es, d'enseignant.es, de praticien.nes, de décideur.ses politiques et de militant.es.",
  "home.contribute.Help expand our database": "Aidez-nous à élargir notre base de données en modifiant le contenu existant ou en publiant le vôtre. La publication d'entrées sur Participedia permet de découvrir plus facilement votre travail, tout en contribuant à un effort de collaboration pour documenter des exemples de participation publique et d'innovation démocratique.",
  "home.explore our database": "Explorez notre base de données de cas, de méthodes et d'organisations en utilisant la barre de recherche ci-dessus, %s téléchargez les données dans les fichiers csv %s ou %s explorez les entrées par lieu %s .",
  "home.newsletter.p1": "Inscrivez-vous à notre newsletter communautaire ! Nous partageons les dernières informations sur les innovations en matière de démocratie participative dans le monde entier, les histoires de notre vaste communauté de partenaires et de contributeur.rices, les invitations aux conférences et événements à venir, et bien plus encore.",
  "home.participediaschool.use": "et utilisez Participedia en classe pour impliquer les étudiants et présenter leurs recherches. Participez aux écoles Participedia et obtenez des perspectives mondiales avec des chercheurs et des praticiens de premier plan.",
  "home.supporters.p1": "Participedia est soutenu par le %sConseil de recherches en sciences humaines du Canada%s (CRSH) à travers une subvention de partenariat.",
  "home.supporters.p2": "L'équipe de conception et technologie opère à partir du %sStudio for Extensive Aesthetics%s de la %sEmily Carr University of Art + Design%s et est soutenue par le %s Programme des Chaires de Recherche du Canada %s et la %s Fondation Canadienne pour l'innovation %s .",
  "home.teach.Use Participedia in the classroom": "Utilisez Participedia en classe pour impliquer les élèves et présenter leurs recherches.",
  "home.verify_email.text": "Veuillez vérifier votre adresse e-mail. Si vous n'avez pas reçu l'e-mail, vérifiez votre boîte de courrier indésirable ou essayez %s de renvoyer l'e-mail de vérification %s .",
  "home.verify_email.title": "Vérifiez votre e-mail",
