  "home_hero.feature.8376": "Assemblées citoyennes transnationales",
  "home_hero_tagline": "Un réseau mondial et une plateforme de crowdsourcing pour les chercheur.es, les enseignant.es, les praticien.nes, les décideur.ses politiques, les activistes et toute personne intéressée par la participation publique et les innovations démocratiques",
  "Honduras": "Honduras",
  "Hong Kong": "Hong Kong",
  "hosted.with.partner": "En partenariat avec",
  "hosted.with.partner.end": "(CERi), l'école d'été CERi-Participedia sur la démocratie radicale (du 4 au 10 juin 2023) s'est concentrée sur la théorie et la pratique de la démocratie radicale pour explorer les thèmes du pouvoir et de la perturbation, de la gouvernance autochtone, de la créativité et de l'attention. L'école a réuni des experts de premier plan, des chercheurs, des étudiants diplômés, des dirigeants communautaires, des militants et des praticiens pour une semaine d'ateliers, de discussions, de dialogues, d'événements communautaires et d'excursions sur le terrain. Les étudiants se sont joints aux sciences sociales, notamment aux sciences politiques, à la philosophie politique, aux médias et aux communications, à la sociologie, aux études culturelles, à l'anthropologie, à l'économie, à l'environnement et aux disciplines connexes. Ensemble, avec l'équipe de l'école d'été et les invités, nous avons exploré ce que signifie réimaginer, rechercher et pratiquer radicalement la démocratie dans leurs communautés et dans la vie quotidienne.",
  "How does translation work?": "Comment fonctionne la traduction?",
  "how_does_translation_work_p1": "Sur une page d'entrée, trois champs sont remplis de texte de forme libre généré par l'utilisateur. Nous appelons ces champs «Open Text», ce sont le titre, la brève description et le récit. Les autres champs sont des nombres, des dates ou des options fixes. Nous appelons ces champs \"Données fixes\".",
  "how_does_translation_work_p2": "Lorsqu'une entrée est publiée pour la première fois, nous traduisons automatiquement les champs Open Text dans toutes les autres langues prises en charge. À partir de ce moment, les champs Open Text existent en tant que versions entièrement séparées (c'est-à-dire «fourchues») pour chaque langue, tandis que les champs Fixed Data sont synchronisés entre toutes les langues. Si vous modifiez un champ de données fixes lors de l'affichage du site dans n'importe quelle langue, cette modification sera visible sur la page d'entrée pour toutes les langues. Toutefois, si vous modifiez le titre, la brève description ou le texte narratif, ces modifications seront enregistrées uniquement dans le texte ouvert de la langue dans laquelle vous écrivez.",
  "how_does_translation_work_p3": "Veuillez cliquer sur le bouton flottant \"modifier\" situé en bas à droite de la page pour ajouter des informations ou améliorer les traductions automatiques de toute entrée.",
  "how_does_translation_work_p4": "Pour afficher et modifier une entrée dans une autre langue, utilisez le sélecteur de langue déroulant situé dans la barre de menu supérieure et le pied de page du site pour changer votre langue préférée.",
