  "participedia.registration.scholarships.p1.1": "Les inscriptions et les demandes de bourses sont désormais closes. Pour rejoindre la liste d'attente,",
  "participedia.registration.scholarships.p1.2": "Toute la nourriture et les boissons pendant le programme seront fournies aux participants.",
  "participedia.registration.scholarships.p2": "Les candidatures aux bourses de voyage et de logement sont désormais closes. Des bourses limitées de dispense d’inscription sont disponibles en fonction des « besoins » et peuvent être indiquées dans le formulaire d’inscription.",
