  "research.data_downloads.organizations_csv": "Télécharger les organisations CSV",
  "research.data_downloads.p1": "Les données Participedia en temps réel peuvent être téléchargées sous forme de fichiers csv aux liens suivants:",
  "research.data_downloads.p2": "L'amélioration de la qualité de l'ensemble de données Participedia est un processus continu, et nous apprécions les commentaires sur tout aspect de nos données et la façon dont nous permettons leur utilisation. Les données Participedia en temps réel sont disponibles sur les liens suivants :",
  "research.data_downloads_header": "Téléchargements de données en temps réel",
  "research.data_repository.dataverse": "Référentiel Dataverse",
  "research.data_repository.feature.1": "métriques sur le nombre de téléchargements de chaque ensemble de données;",
  "research.data_repository.feature.2": "la possibilité de télécharger des ensembles de données dans plusieurs formats;",
  "research.data_repository.feature.3": "la possibilité d'effectuer l'analyse des données directement à travers l'interface utilisateur sans télécharger de données, puisque %sR%s est intégré à l'interface utilisateur;",
  "research.data_repository.feature.4": "conservation à long terme des données;",
  "research.data_repository.feature.5": "attribution automatique d'identificateurs d'objets numériques (DOIs) et d'autres métadonnées conformes aux normes pour permettre la citation d'ensembles de données;",
  "research.data_repository.feature.6": "indexation des ensembles de données dans les principaux moteurs de recherche pour aider les utilisateur.rice.s à trouver les données;",
  "research.data_repository.feature.7": "création d'empreintes digitales pour permettre l'authentification des ensembles de données; Et",
  "research.data_repository.feature.8": "une API ouverte qui permet l'utilisation des données et des métadonnées par d'autres services web.",
  "research.data_repository.p1": "La majorité des recherches sur les innovations démocratiques et les processus participatifs qui se déroulent dans le monde ne sont pas accessibles au public. Ces documents comprennent des ensembles de données, des livres-codes, des scripts ou des synthèses de logiciels statistiques, des monographies, des articles de conférence, ainsi que des évaluations et rapports de praticien.ne.s. La %sBase de données Participedia%s héberge ces documents dans une base de données accessible et organisée qui permet de les archiver et les préserver sur le long terme, mais aussi qui génère des descriptions standardisées et des identificateurs facilitant la découverte et la citation de ce matériel.",
  "research.data_repository.p2": "Les chercheur.e.s et les praticien.ne.s peuvent contribuer à la base de données Participedia en déposant gratuitement leurs documents de recherche. Les caractéristiques du recueil de données Participedia incluent:",
  "research.data_repository.questions": "Pour toute question concernant la façon de contribuer à la base de données Participedia, veuillez contacter %sdata@participedia.net%s.",
  "research.methodology.p1": "La stratégie est simple : rassembler des informations sur les innovations démocratiques du monde entier et les réunir dans une base de données publique qui est continuellement mise à jour grâce aux nouvelles contributions. La plate-forme Participedia est publiée sous  %sLicense Creative Commons%s et est accessible et modifiable par tou.te.s.",
  "research.methodology.p2": "Pour une explication approfondie de l’histoire, des aspirations, de la théorie et de l’approche analytique de Participedia, voir «%sLe projet Participedia: une introduction%s», par les deux fondateurs de Participedia, Archon Fung et Mark E. Warren. Pour plus d'informations sur la façon dont vous pouvez contribuer au projet, veuillez consulter nos %slignes directrices%s.",
  "research.surveys.p1": "Les questionnaires complètent les données et les descriptions explicatives actuelles de Participedia; ils visent à obtenir un aperçu plus approfondi des résultats et des effets des cas.",
  "research.surveys.p2": "Le questionnaire auprès des participants permettra de saisir l'expérience des personnes directement impliquées dans un processus participatif. Le questionnaire peut être remis par les organisateur.rice.s à l'endroit même où se déroule le dit processus, ou alors, les participant.e.s peuvent le compléter après l'événement.",
  "research.surveys.p3": "Le questionnaire auprès des observateur.rice.s permettra de recueillir des points de vue relatifs à l'impact plus large d'un cas spécifique. Parmi les «observateur.rice.s» on retrouve les praticien.ne.s, les participant.e.s ou encore les chercheur.e.s ayant une connaissance particulière du cas.",
  "research.surveys.p4": "Les questionnaires Participedia sont présentement à l'essai mais seront bientôt disponibles en téléchargement.",
  "research.tagline": "Participedia est guidé par la question de recherche suivante: quels types de processus participatifs fonctionnent le mieux, à quelles fins, et dans quelles conditions?",
