  "teaching.Discussion.p1": "Nous avons créé une discussion de groupe où n'importe qui peut discuter des ressources d'enseignement et d'apprentissage ainsi que de pédagogie démocratique. Joignez-vous au groupe Facebook Participedia pour contribuer à la conversation et poser des questions à la communauté universitaire.",
