  "teaching.in_the_classroom": "Participedia en classe",
  "teaching.in_the_classroom.p1": "Écrire ou éditer des articles pour Participedia peut s'avérer un excellent travail dans le cadre de cours qui traitent de la participation politique, de l'innovation démocratique, ou de la délibération.",
  "teaching.in_the_classroom.p2": "Au cours du processus de sélection, de recherche et de rédaction d'un cas, d'une méthode ou d'une organisation, les élèves connaîtront la substance de la participation dans des contextes variés. Les élèves peuvent aussi trouver gratifiant que leur travail soit présenté sur Participedia.",
  "teaching.in_the_classroom.p3": "Les ressources suivantes présentent des idées sur la façon d’améliorer l'offre de cours sur la participation publique:",
  "teaching.Join Group Chat About Teaching Resources": "Joignez-vous à la discussion de groupe sur les ressources d'enseignement",
  "teaching.learning_webinar": "Série de webinaires sur l'enseignement et l'apprentissage démocratiques",
  "teaching.learning_webinar.p1": "Cette série de webinaires a été conçue pour connecter les chercheurs et les collaborateurs de Participedia ayant des intérêts communs et pour échanger des connaissances sur les défis et les réussites dans le domaine des méthodes d'enseignement, des théories et des cas qui soutiennent la participation démocratique. La série a été développée et lancée en 2018 par les coprésidents du comité d'enseignement, de formation et de mentorat de %s Participedia.net %s , les Drs. Joanna Ashworth et Bettina von Lieres.",
  "teaching.Lesson Plans": "Plans de cours",
  "teaching.Participedia provides open access to": "Participedia offre un libre accès à des ressources collaboratives qui sont utiles pour les étudiant.e.s de premier cycle et de cycles supérieurs, ainsi qu'à des ressources de perfectionnement professionnel pour les praticien.ne.s, les organisations de la société civile et les ONG. Les ressources comprennent aussi bien des plans de cours et devoirs en classe, que des manuels, simulations et du matériel de formation multi-média.",
  "teaching.Please use this form": "Veuillez utiliser %sce formulaire%s ou envoyer un courriel à %sinfo@participedia.net%s si vous avez des ressources à partager.",
  "teaching.Quizzes/Tests": "Questionnaires / Examens",
  "teaching.resource.p1": "Accroître la connaissance des élèves sur les innovations en matière de démocratie participative;",
  "teaching.resource.p2": "Améliorer les compétences des élèves en matière de recherche et de rédaction en publiant des études de cas, de méthodes et d'organisations sur Participedia;",
  "teaching.resource.p3": "Améliorer la capacité des élèves à établir des liens entre théorie et pratique de la participation publique;",
  "teaching.resource.p4": "Préparer les élèves à être organisateur.rice.s et chercheur.e.s d'innovations démocratiques, et;",
